import logoBlack from './img/logo_black.png';
import topArticle from './img/article_images/1.png';
import janayWright from './img/avatars/JanayWright.png';
import views from './img/viewsImg.png';
import {Footer} from "./components/Footer/Footer";
import {Main} from "./components/Main/Main";
import {TopArticle} from "./components/TopArticle/TopArticle";

function App() {
  return (
    <div className="App">
        <header className="header-container">
        <div className="App-header">
          <img src={logoBlack} width={268} height={32}/>
          <nav>
              <button className="signIn">Log in</button>
              <button className="logIn">Sign in</button>
          </nav>
        </div>
        </header>
        <TopArticle/>
        <Main/>
        <Footer/>
    </div>
  );
}

export default App;
